import React from 'react';
import './CompanyLogin.css';

function CompanyLogin() {
    return (
       <div class='c'>
           <h1>COMPANY LOGIN</h1>
            <form>
                 <div class='cl'>
           <div class='in'> Username <input type='text'/>  </div>
           <div class='in'> <p>Password</p>  <input type='password'/>  </div>
            <button class='button'>Login</button>
            </div>
            </form>
     </div>
    )
}

export default CompanyLogin
